import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import './Profile.css';

const Profile = () => {
  const [user, setUser] = useState(null);
  const [userShops, setUserShops] = useState([]);
  const [isLoading, setIsLoading] = useState(true);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchUserData = async () => {
      try {
        const token = localStorage.getItem('token');
        const userId = localStorage.getItem('userId');

        if (!token || !userId) {
          navigate('/login');
          return;
        }

        const [userResponse, shopsResponse] = await Promise.all([
          axios.get(`http://localhost:5000/api/users/${userId}`, {
            headers: { Authorization: `Bearer ${token}` }
          }),
          axios.get(`http://localhost:5000/api/shops/user/${userId}`, {
            headers: { Authorization: `Bearer ${token}` }
          })
        ]);

        setUser(userResponse.data);
        setUserShops(shopsResponse.data);
      } catch (error) {
        console.error('Error fetching user data:', error);
        if (error.response?.status === 401) {
          navigate('/login');
        }
      } finally {
        setIsLoading(false);
      }
    };

    fetchUserData();
  }, [navigate]);

  const handleToggleStatus = async (shopId) => {
    try {
      const token = localStorage.getItem('token');
      const shop = userShops.find(s => s._id === shopId);
      const newStatus = !shop.isOpen;
      
      await axios.put(
        `http://localhost:5000/api/shops/${shopId}/toggle-status`,
        { isOpen: newStatus },
        { headers: { Authorization: `Bearer ${token}` } }
      );

      setUserShops(prevShops =>
        prevShops.map(shop =>
          shop._id === shopId
            ? { ...shop, isOpen: newStatus }
            : shop
        )
      );
    } catch (error) {
      console.error('Error toggling shop status:', error);
    }
  };

  if (isLoading) {
    return <div className="loading">Loading...</div>;
  }

  if (!user) {
    return <div className="error">Error loading profile</div>;
  }

  return (
    <div className="profile-container">
      <div className="profile-header">
        <h1>Profile</h1>
        <div className="profile-info">
          <h2>{user.name}</h2>
          <p>Email: {user.email}</p>
          <p>Phone: {user.phone}</p>
        </div>
      </div>

      <div className="user-shops">
        <h2>Your Shops</h2>
        {userShops.length === 0 ? (
          <p className="no-shops">You haven't added any shops yet.</p>
        ) : (
          <div className="shops-grid">
            {userShops.map((shop) => (
              <div key={shop._id} className="shop-card">
                <img 
                  src={shop.imageUrl || 'https://via.placeholder.com/300x200?text=No+Image'} 
                  alt={shop.shopName} 
                  className="shop-image"
                />
                <div className="shop-info">
                  <h3>{shop.shopName}</h3>
                  <p>Location: {shop.location}</p>
                  <p className={`status ${shop.isOpen ? 'open' : 'closed'}`}>
                    {shop.isOpen ? 'Open' : 'Closed'}
                  </p>
                  <div className="shop-actions">
                    <button
                      className="edit-btn"
                      onClick={() => navigate(`/edit-shop/${shop._id}`)}
                    >
                      Edit Shop
                    </button>
                    <button
                      className="toggle-status-btn"
                      onClick={() => handleToggleStatus(shop._id)}
                    >
                      {shop.isOpen ? 'Mark as Closed' : 'Mark as Open'}
                    </button>
                  </div>
                </div>
              </div>
            ))}
          </div>
        )}
      </div>
    </div>
  );
};

export default Profile;
